import React, { Component } from 'react';
import './Users.scss';


class Users extends Component {
    constructor(props) {
        super(props);
    }

    render() {
      return (
        <div className="c-users">
                  {this.props.users.map((item, index) => {
                      return (
                        <div className="card"> 
                         {item.nom_prenom}
                        </div> 
                      )
                    })}
            </div>
      );
    }
  }




  export default Users;
